Everybody at one point or another in college, has played kings cup, which is no surprise what this latest submission is all about, but with a twist. In this game, the winner was a super hot queen, and she got to do whatever she wanted, so why not do all the three guys in the room. This became one of the most craziest, and original kings cup game we have ever witness. Even better, all of the girls are super hot and ready to party.
